package examples import ( "strings" "testing" "github.com/stretchr/testify/require" "github.com/xssnick/tonutils-go/liteclient" "github.com/xssnick/tonutils-go/ton" "github.com/xssnick/tonutils-go/ton/wallet" "github.com/smartcontractkit/chainlink-testing-framework/framework" "github.com/smartcontractkit/chainlink-testing-framework/framework/components/blockchain"
) type CfgTon struct { BlockchainA *blockchain.Input `toml:"blockchain_a" validate:"required"`
} func TestTonSmoke(t *testing.T) { in, err := framework.Load[CfgTon](t) require.NoError(t, err) bc, err := blockchain.NewBlockchainNetwork(in.BlockchainA) require.NoError(t, err) // we can also explicitly terminate the container after the test defer bc.Container.Terminate(t.Context()) var client ton.APIClientWrapped t.Run("setup:connect", func(t *testing.T) { // Create a connection pool connectionPool := liteclient.NewConnectionPool() // Get the network configuration from the global config URL cfg, cferr := liteclient.GetConfigFromUrl(t.Context(), fmt.Sprintf("http://%s/localhost.global.config.json", bc.Nodes[0].ExternalHTTPUrl)) require.NoError(t, cferr, "Failed to get config from URL") // Add connections from the config caerr := connectionPool.AddConnectionsFromConfig(t.Context(), cfg) require.NoError(t, caerr, "Failed to add connections from config") // Create an API client with retry functionality client = ton.NewAPIClient(connectionPool).WithRetry() t.Run("setup:faucet", func(t *testing.T) { // Create a wallet from the pre-funded high-load wallet seed rawHlWallet, err := wallet.FromSeed(client, strings.Fields(blockchain.DefaultTonHlWalletMnemonic), wallet.HighloadV2Verified) require.NoError(t, err, "failed to create highload wallet") // Create a workchain -1 (masterchain) wallet mcFunderWallet, err := wallet.FromPrivateKeyWithOptions(client, rawHlWallet.PrivateKey(), wallet.HighloadV2Verified, wallet.WithWorkchain(-1)) require.NoError(t, err, "failed to create highload wallet") // Get subwallet with ID 42 funder, err := mcFunderWallet.GetSubwallet(uint32(42)) require.NoError(t, err, "failed to get highload subwallet") // Verify the funder address matches the expected default require.Equal(t, funder.Address().StringRaw(), blockchain.DefaultTonHlWalletAddress, "funder address mismatch") // Check the funder balance master, err := client.GetMasterchainInfo(t.Context()) require.NoError(t, err, "failed to get masterchain info for funder balance check") funderBalance, err := funder.GetBalance(t.Context(), master) require.NoError(t, err, "failed to get funder balance") require.Equal(t, funderBalance.Nano().String(), "1000000000000000", "funder balance mismatch") }) })
}

