}, out.RedPanda.SchemaRegistryExternalURL)
if protoErr != nil { panic(protoErr)
} Since ProtoSchemaSet has TOML tags you can also read it from a TOML file with this content: [[proto_schema_set]]
owner = 'smartcontractkit'
repository = 'chainlink-protos'
ref = '626c42d55bdcb36dffe0077fff58abba40acc3e5'
folders = ['workflows'] using this code: var protoSchemaSets []chipingressset.ProtoSchemaSet
for _, schemaSet := range configFiles { file, fileErr := os.ReadFile(schemaSet) if fileErr != nil { return errors.Wrapf(fileErr, "failed to read proto schema set config file: %s", schemaSet) } type protoSchemaSets struct { Sets []chipingressset.ProtoSchemaSet `toml:"proto_schema_set"` } var sets protoSchemaSets if err := toml.Unmarshal(file, &sets); err != nil { return errors.Wrapf(err, "failed to unmarshal proto config file: %s", protoConfig) } protoSchemaSets = append(reposConfigs, sets.Sets...)
} Registration logic is very simple and should handle cases of protos that import other protos as long they are all available in the ProtoSchemaSets provided to the registration function. That function uses an algorithm called "topological sorting by trail", which will try to register all protos in a loop until it cannot register any more protos or it has registered all of them. That allows us to skip dependency parsing completely. Since Kafka doesn't have any automatic discoverability mechanism for subject - schema relationship (it has to be provided out-of-band) code currently only knows how to correctly register protos from chainlink-protos repository.

