) type Input struct { // inputs fields that component exposes for configuration ... // outputs are embedded into inputs so framework can automatically save them Out *Output `toml:"out"`
} type Output struct { UseCache bool `toml:"use_cache"` // outputs that will be dumped to config and cached
} func NewComponent(input *Input) (*Output, error) { if input.Out != nil && input.Out.UseCache { return input.Out, nil } // component logic here // deploy a docker container(s) // or deploy a set of smart contracts input.Out = &Output{ UseCache: true, // other fields ... } return out, nil
} Each component can define inputs and outputs, following these rules: Outputs should be included within inputs. If your component is used for side effects output can be omitted. input.Out.UseCache should be added if you'd like to use caching, see more here

