Seth supports pre/post operation hooks for two functions: DeployContract() Decode (also DecodeTx) As the name suggest each will be executed before and after mentioned operation. By default, no hooks are set. Adding hooks doesn't influence retry/gas bumping logic. You can either set hooks directly on the seth.Config object (not recommended) or pass them to the ClientBuilder: // assuming backend is the simulated backend, to show how we can speed up contract deployments by calling `Commit()` right after deploying the contract
hooks := seth.Hooks{ ContractDeployment: seth.ContractDeploymentHooks{ Post: func(client *seth.Client, tx *types.Transaction) error { backend.Commit() return nil }, },
} client, err := builder. WithNetworkName("simulated"). WithHooks(hooks). WithEthClient(backend.Client()). WithPrivateKeys([]string{"ac0974bec39a17e36ba4a6b4d238ff944bacb478cbed5efcae784d7bf4f2ff80"}). Build() if err != nil { log.Fatal(err)
}

