If the task to be executed requires no payload (or it's the same for each task) using the tool is much simpler. First you need to create an instance of the executor: l := logging.GetTestLogger(nil) executor := concurrency.NewConcurrentExecutor[ContractIntstance, contractResult, concurrency.NoTaskType](l) Where generic parameters represent (from left to right): type of execution result type of channel that holds the results type of task payload In our case, we want the execution to return ContractInstances, that will be stored by this type: type contractResult struct { instance ContractIntstance
} And which won't use any payload, as indicated by a no-op concurrency.NoTaskType. Then, we need to define a function that will be executed for each task. For example: var deployContractFn = func(channel chan contractResult, errorCh chan error, executorNum int) { keyNum := executorNum + 1 // key 0 is the root key instance, err := client.deployContractFromKey(keyNum) if err != nil { errorCh <- err return } channel <- contractResult{instance: instance}
} It needs to have the following signature: type SimpleTaskProcessorFn[ResultChannelType any] func(resultCh chan ResultChannelType, errorCh chan error, executorNum int) and send results of successful execution to resultCh and errors to errorCh. Once the processing function is defined all that's left is the execution: results, err := executor.ExecuteSimple(client.getConcurrency(), numberOfContracts, deployContractFn) Parameters for ExecuteSimple (without payload) are as follows(from left to right): concurrency count (number of parallel executors) total number of executions function to execute results contain a slice with results of each execution with ContractInstance type. err will be non-nil if any of the executions failed. To get all errors you should call executor.GetErrors().

