) func addHardcodedLabelsToEnv(env *environment.Config) { env.Labels = []string{"chain.link/product=myProduct", "chain.link/team=my-team", "chain.link/cost-center=test-tooling-load-test"} env.WorkloadLabels = map[string]string{"chain.link/product": "myProduct", "chain.link/team": "my-team", "chain.link/cost-center": "test-tooling-load-test"} env.PodLabels = map[string]string{"chain.link/product": "myProduct", "chain.link/team": "my-team", "chain.link/cost-center": "test-tooling-load-test"}
} func main() { env := &environment.Config{ NamespacePrefix: "new-environment", KeepConnection: false, RemoveOnInterrupt: false, } addHardcodedLabelsToEnv(env) err := environment.New(env). AddHelm(ethereum.New(nil)). AddHelm(chainlink.New(0, nil)). Run() if err != nil { panic(err) }
} Then run go run examples/simple/env.go Now you have your environment running, you can connect to it later note chain.link/* labels are used for internal reporting and cost allocation. They are strictly required and validated. You won't be able to create a new environment without them. In this tutorial we create almost all of them manually, but there are convenience functions to do it for you. You can read more about labels here

