// Config is an environment common configuration, labels, annotations, connection types, readiness check, etc.
type Config struct { // TTL is time to live for the environment, used with kyverno TTL time.Duration // NamespacePrefix is a static namespace prefix NamespacePrefix string // Namespace is full namespace name Namespace string // Labels is a set of labels applied to the namespace in a format of "key=value" Labels []string // PodLabels is a set of labels applied to every pod in the namespace PodLabels map[string]string // WorkloadLabels is a set of labels applied to every workload in the namespace WorkloadLabels map[string]string // PreventPodEviction if true sets a k8s annotation safe-to-evict=false to prevent pods from being evicted // Note: This should only be used if your test is completely incapable of handling things like K8s rebalances without failing. // If that is the case, it's worth the effort to make your test fault-tolerant soon. The alternative is expensive and infuriating. PreventPodEviction bool // Allow deployment to nodes with these tolerances Tolerations []map[string]string // Restrict deployment to only nodes matching a particular node role NodeSelector map[string]string // ReadyCheckData is settings for readiness probes checks for all deployment components // checking that all pods are ready by default with 8 minutes timeout //	&client.ReadyCheckData{ // ReadinessProbeCheckSelector: "", // Timeout: 15 * time.Minute, //	} ReadyCheckData *client.ReadyCheckData // DryRun if true, app will just generate a manifest in local dir DryRun bool // InsideK8s used for long-running soak tests where you connect to env from the inside InsideK8s bool // SkipManifestUpdate will skip updating the manifest upon connecting to the environment. Should be true if you wish to update the manifest (e.g. upgrade pods) SkipManifestUpdate bool // KeepConnection keeps connection until interrupted with a signal, useful when prototyping and debugging a new env KeepConnection bool // RemoveOnInterrupt automatically removes an environment on interrupt RemoveOnInterrupt bool // UpdateWaitInterval an interval to wait for deployment update started UpdateWaitInterval time.Duration // Remote Runner Specific Variables // // JobImage an image to run environment as a job inside k8s JobImage string // Specify only if you want remote-runner to start with a specific name RunnerName string // Specify only if you want to mount reports from test run in remote runner ReportPath string // JobLogFunction a function that will be run on each log JobLogFunction func(*Environment, string) // Test the testing library current Test struct Test *testing.T // jobDeployed used to limit us to 1 remote runner deploy jobDeployed bool // detachRunner should we detach the remote runner after starting the test detachRunner bool // fundReturnFailed the status of a fund return fundReturnFailed bool
}

