This documentation is deprecated, we are using it in Chainlink Integration Tests If you want to test our new products use v2 These basic building blocks can be used to create a TOML config file. For example: import ( ctf_config "github.com/smartcontractkit/chainlink-testing-framework/config" ctf_test_env "github.com/smartcontractkit/chainlink-testing-framework/docker/test_env"
) type TestConfig struct { ChainlinkImage *ctf_config.ChainlinkImageConfig `toml:"ChainlinkImage"` ChainlinkUpgradeImage *ctf_config.ChainlinkImageConfig `toml:"ChainlinkUpgradeImage"` Logging *ctf_config.LoggingConfig `toml:"Logging"` Network *ctf_config.NetworkConfig `toml:"Network"` Pyroscope *ctf_config.PyroscopeConfig `toml:"Pyroscope"` PrivateEthereumNetwork *ctf_test_env.EthereumNetwork `toml:"PrivateEthereumNetwork"`
} It's up to the user to provide a way to read the config from file and unmarshal it into the struct. You can check testconfig.go to see one way it could be done. Validate() should be used to ensure that the config is valid. Some of the building blocks have also a Default() method that can be used to get default values. Also, you might find BytesToAnyTomlStruct(logger zerolog.Logger, filename, configurationName string, target any, content []byte) error utility method useful for unmarshalling TOMLs read from env var or files into a struct

